contracts/CampaignRegistry.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./CampaignTreasury.sol";
import "./CampaignNFT.sol";

contract CampaignRegistry is Ownable {
    address factoryAddress;
    address campaignNFTAddress;
    address campaignGlobalParameters;
    address campaignFeeSplitter;
    bool initialized;
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    mapping(string => address) campaignIdentifierToAddress;

    function initialize(
        address _factoryAddress,
        address _campaignNFTAddress,
        address _campaignGlobalParameters, 
        address _campaignFeeSplitter
    ) public onlyOwner {
        factoryAddress = _factoryAddress;
        campaignNFTAddress = _campaignNFTAddress;
        campaignGlobalParameters = _campaignGlobalParameters;
        campaignFeeSplitter = _campaignFeeSplitter;
        initialized = true;
    }

    modifier onlyFactory() {
        require(msg.sender == factoryAddress);
        _;
    }

    modifier isInitialized() {
        require(initialized);
        _;
    }

    function getFactoryAddress() public view isInitialized returns (address) {
        return factoryAddress;
    }

    function getCampaignNFTAddress()
        public
        view
        isInitialized
        returns (address)
    {
        return campaignNFTAddress;
    }

    function getCampaignGlobalParameters()
        public
        view
        isInitialized
        returns (address)
    {
        return campaignGlobalParameters;
    }

    function getCampaignFeeSplitter()
        public
        view
        isInitialized
        returns (address)
    {
        return campaignFeeSplitter;
    }

    function getCampaignInfoAddress(
        string calldata identifier
    ) public view isInitialized returns (address) {
        require(
            campaignIdentifierToAddress[identifier] != address(0),
            "CampaignRegistry: CampaignInfo not created"
        );
        return campaignIdentifierToAddress[identifier];
    }

    function setCampaignInfoAddress(
        string calldata _identifier,
        address _campaignAddress
    ) public isInitialized onlyFactory {
        campaignIdentifierToAddress[_identifier] = _campaignAddress;
        CampaignNFT(campaignNFTAddress).grantRole(
            MINTER_ROLE,
            _campaignAddress
        );
    }
}

contracts/CampaignTreasury.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "./CampaignRegistry.sol";
import "./CampaignInfo.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract CampaignTreasury {
    address registryAddress;
    address infoAddress;
    bytes32 platformId;
    uint256 pledgedAmount;
    uint256 platformFeePercent;
    uint256 constant percentDivider = 10000;

    constructor(
        address _registryAddress,
        address _infoAddress,
        bytes32 _platformId
    ) {
        registryAddress = _registryAddress;
        infoAddress = _infoAddress;
        platformId = _platformId;
    }

    modifier onlyCampaignInfo() {
        require(
            msg.sender == infoAddress,
            "CampaignTreasury: Caller is not CampaignInfo contract"
        );
        _;
    }

    function getplatformId() public view returns (bytes32) {
        return platformId;
    }

    function getplatformFeePercent() public view returns (uint256) {
        return platformFeePercent;
    }

    function getplatformFee() public view returns (uint256) {
        return (pledgedAmount * platformFeePercent) / percentDivider;
    }

    function getTotalCollectableByCreator() public view returns (uint256) {
        return pledgedAmount - getplatformFee();
    }

    function getPledgedAmount() public view returns (uint256) {
        return pledgedAmount;
    }

    function setplatformFeePercent(uint256 _platformFeePercent) public {
        platformFeePercent = _platformFeePercent;
    }

    function disburseFeeToPlatform(
        address _platform,
        address _token,
        uint256 _amount
    ) public onlyCampaignInfo {
        IERC20(_token).transfer(_platform, _amount);
    }
}

